import React from 'react';
import { Navigate } from "react-router-dom";
import {useSelector} from "react-redux";

const Auth = () => {
    const {isAuth} = useSelector(state => state.userReducer)


    if (isAuth) {
        return redirect("/");
    }

    return (
        <div>
            {/*{isAuth && <Navigate to="/" replace={true} />}*/}
            AUTH
        </div>
    );
};

export default Auth;
